chael.tan@yale.edu','Eric Pan','eric.pan@yale.edu'),(5,'The algorithm is correct.','The algorithm works in O(1) time.  The algorithm is banned in China.  The algorithm was discovered by Gundula.\r\n\r\nSincerely,\r\nAlgorithm Algoman','2013-04-02 03:15:49','2013-04-02 03:15:49',2,1,'Michael Tan','michael.tan@yale.edu','Eric Pan','eric.pan@yale.edu'),(6,'The algorithm is correct.','The algorithm works in O(1) time.  The algorithm is banned in China.  The algorithm was discovered by Gundula.\r\n\r\nSincerely,\r\nAlgorithm Algoman','2013-04-02 03:15:58','2013-04-02 03:15:58',2,1,'Michael Tan','michael.tan@yale.edu','Eric Pan','eric.pan@yale.edu'),(7,'Can I have your password?','Type f to flash your password.','2013-04-02 03:20:02','2013-04-02 03:20:02',2,1,'Michael Tan','michael.tan@yale.edu','Eric Pan','eric.pan@yale.edu'),(8,'advice for a YSC-er','hey jason,\r\nthanks for putting yourself on the alumni database!  i graduated last year in 2012 and have spent this year in Paris France doing STINT with Cru.  i\'m in the process of figuring out where i want to go and what i want to do next year [or in life], and pursuing music has always been something on my radar.  i would love to talk to you and hear about how you got started with that and how you do it...epecially given that we both seem to have a heart for international ministry and for music [and hip hop, i was president of Rhythmic Blue at yale ;)]  \r\ncould we skype or talk on the phone some time?  it would be awesome to hear your perspective and ask some questions to someone who may know how to answer.\r\nthanks a million,\r\nalison','2013-05-13 12:06:20','2013-05-13 12:06:20',46,21,'Alison James','alison.james@aya.yale.edu','Jason Chu','jasonchu@aya.yale.edu'),(9,'ysc alumni','please talk to me about \"fides quaerens intellectum\"\r\n\r\nkakakakaka','2013-05-13 16:20:05','2013-05-13 16:20:05',89,76,'Brian K. Lee','brian.k.lee@aya.yale.edu','Yena Lee','yena.lee@aya.yale.edu'),(10,'Stat Padding','This email was sent to pad our emails sent statistic.','2013-05-22 00:15:50','2013-05-22 00:15:50',1,10,'Eric Pan','eric.pan@yale.edu','Test Account','tom.ed.awe.67@gmail.com');
