co. I also teach as an adjunct in graduate design/innovation programs in Chicago and Monterrey, Mexico.\r\n\r\nI\'ve experienced full-time ministry through Campus Crusade, and volunteer ministry as a church member and elder. At one point, I served on the Chapter (lay leadership board) of an Episcopal cathedral; I currently am involved in a startup Anglican church of about 20 people in the San Francisco suburbs.\r\n\r\nI have often felt that my journey since Yale has been circuitous and somewhat random. However, recurring patterns give me hope that God has a grand design. My experiences on staff with Campus Crusade help me be a better leader in my firm; my professional experiences have recently helped me advise leaders in Campus Crusade and other ministries on how to plan and manage their futures. \r\n','','1990','History',37.8044,-122.271,'david_mg_0325_cropped.jpg','image/jpeg',92564,'2013-05-10 20:20:27','timothy_dwight',NULL),(30,'a.wang@aya.yale.edu','Amy Wang Johnson',NULL,NULL,'2013-05-10 20:10:28','2013-05-10 20:12:19','$2a$10$w6EOV6rULQ1qrEQ7muMDDuayC1vVVGFlds4zSwATA4Z3QF1R0krIS','8HDztXc4TB62NI8U',0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(31,'janice.lam@aya.yale.edu','Janice Lam',NULL,NULL,'2013-05-10 20:25:03','2013-05-11 03:33:51','$2a$10$Xwb7juGlHRFbGLBl3F3Ixu3ZkUOuGuy0qpbwvnHBP/tdXd/DrMsFi','vJe6LhJtbqds3utt',0,1,0,'UK','','London',NULL,'Lawyer','Married to Philip Lam (SM\'01), 3 children','','2000','History',51.5112,-0.119824,NULL,NULL,NULL,NULL,'branford',NULL),(32,'carol.yu@aya.yale.edu','Carol Yu',NULL,NULL,'2013-05-10 20:37:07','2013-05-10 20:41:29','$2a$10$J.aGdidkQ1Bbcf7a8BFCHuL5TAeEZyGV6KOuUmM5p7I7cTf7u2awq','Ze9_Bt2kebRJltb3',0,1,0,'United States','MA','Somerville',NULL,'Research Analyst','','','2008','East Asian Studies',42.3876,-71.0995,'headshot.jpg','image/jpeg',5953,'2013-05-10 20:41:28','trumbull',NULL),(33,'mike4him@gmail.com','Mike Dunbar',NULL,NULL,'2013-05-10 20:59:25','2013-05-10 21:51